import React from "react";
import ColorSchemesExample from "./Header/navbarhead";

const Mainpage = () => {
  return (
    <div className="main-Mainpage">
      <nav className="navbar-Mainpage">
        <ul >
          <li style={styles.navItem}>
            <a href="/">Home</a>
          </li>
          <li style={styles.navItem}>
            <a href="/about">About</a>
          </li>
          <li style={styles.navItem}>
            <a href="/services">Services</a>
          </li>
          <li style={styles.navItem}>
            <a href="/contact">Contact</a>
          </li>
        </ul>
      </nav>

      {/* Header Section */}
      <header>
        {/* Here you can add content for the header or import a header component */}
      </header>
    </div>
  );
};

const styles = {
  navList: {
    listStyleType: "none",
    display: "flex",
    justifyContent: "space-around",
    padding: 0,
    backgroundColor: "#333",
    marginBottom: "20px",
  },
  navItem: {
    color: "white",
  },
};

export default Mainpage;
